/* compare current time with startTime and stopTime
   if current time is inbetween, return 1, 
   else return 0 
*/ 

// create current Date
var currentDate = new Date();
// convert into milliseconds passed since midnight Jan 1 1970
var currentTime = currentDate.getTime();

var startDate1 = flow.get('startDate1') || 0;
var stopDate1 = flow.get('stopDate1') || 0;
var startDate2 = flow.get('startDate2') || 0;
var stopDate2 = flow.get('stopDate2') || 0;
var startDate3 = flow.get('startDate3') || 0;
var stopDate3 = flow.get('stopDate3') || 0;
var startDate4 = flow.get('startDate4') || 0;
var stopDate4 = flow.get('stopDate4') || 0;
var startDate5 = flow.get('startDate5') || 0;
var stopDate5 = flow.get('stopDate5') || 0;

// convert into milliseconds passed since midnight Jan 1 1970
try { // .getTime()does only work with typeof "object" (Date)
      // .getTime()does not work when 0 is assigned
    var startTime1 = startDate1.getTime();
    var stopTime1 = stopDate1.getTime();
    var startTime2 = startDate2.getTime();
    var stopTime2 = stopDate2.getTime();
    var startTime3 = startDate3.getTime();
    var stopTime3 = stopDate3.getTime();
    var startTime4 = startDate4.getTime();
    var stopTime4 = stopDate4.getTime();
    var startTime5 = startDate5.getTime();
    var stopTime5 = stopDate5.getTime();
} finally {
    if (((startTime1 < currentTime) && (currentTime < stopTime1)) ||
        ((startTime2 < currentTime) && (currentTime < stopTime2)) ||
        ((startTime3 < currentTime) && (currentTime < stopTime3)) ||
        ((startTime4 < currentTime) && (currentTime < stopTime4)) ||
        ((startTime5 < currentTime) && (currentTime < stopTime5))) {
        msg.payload = 1;
    } else {
        msg.payload = 0;
    }
    return msg;
}

